When Battlestar Galactica finally finds Earth, they learn of the machines, that are inhabiting earth the terminators, soon after Battlestar Galactica makes first contact with John Connors, and his resistance fighters.

General John Connor and Admiral William Adama devised a plan to take down Skynet and the Cylon Empire. The plan calls for Major Kevin Rose and Major Alex Albrecht and Boomer to implement a three step virus. 

If Rose and Albrecht and Boomer are able to take down Skynet, with the Gibson virus, they only won half the battle as the Cylons are only a few months from finding Earth.

